import React, { useEffect, useState } from "react";
import { supabase } from "./supabaseClient";

const CustomerProspects = () => {
  const [prospects, setProspects] = useState([]);
  const [selectedProspect, setSelectedProspect] = useState(null);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    fetchProspects();

    const subscription = supabase
      .channel("customer_prospects")
      .on(
        "postgres_changes",
        { event: "*", schema: "public", table: "customer_prospects" },
        (payload) => {
          console.log("Change received!", payload);
          fetchProspects();
        }
      )
      .subscribe();

    return () => {
      subscription.unsubscribe();
    };
  }, []);

  const fetchProspects = async () => {
    const { data, error } = await supabase
      .from("customer_prospects")
      .select("*")
      .order("id", { ascending: true });

    if (error) {
      console.error("Error fetching prospects:", error);
    } else {
      setProspects(data);
    }
  };

  const handleRowClick = (prospect) => {
    setSelectedProspect(prospect);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
    setSelectedProspect(null);
  };

  return (
    <div className="container mt-4">
      <h2>Customer Prospects</h2>
      <table className="table table-striped table-hover">
        <thead>
          <tr>
            <th>ID</th>
            <th>Company Name</th>
            <th>Contact Person</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Industry</th>
            <th>Estimated Shipping Needs</th>
          </tr>
        </thead>
        <tbody>
          {prospects.map((prospect) => (
            <tr
              key={prospect.id}
              onClick={() => handleRowClick(prospect)}
              style={{ cursor: "pointer" }}
            >
              <td>{prospect.id}</td>
              <td>{prospect.company_name}</td>
              <td>{prospect.contact_person}</td>
              <td>{prospect.email}</td>
              <td>{prospect.phone}</td>
              <td>{prospect.industry}</td>
              <td>{prospect.estimated_shipping_needs}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>{selectedProspect?.company_name}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {selectedProspect && (
            <>
              <p>
                <strong>Description:</strong>{" "}
                {selectedProspect.description || "N/A"}
              </p>
              <p>
                <strong>PO:</strong> {selectedProspect.po || "N/A"}
              </p>
              <p>
                <strong>Pickup Location:</strong> {selectedProspect.pickup_city}
                , {selectedProspect.pickup_state}
              </p>
              <p>
                <strong>Bill Rate:</strong> $
                {selectedProspect.bill_rate?.toFixed(2) || "N/A"}
              </p>
            </>
          )}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default CustomerProspects;
